import IUnitInfo from "../../interface/IUnitInfo";
import DefaultStrategy from "../unitStrategy/DefaultStrategy";
import HealerStrategy from "../unitStrategy/HealerStrategy";
import img from "../../../img/";
export default class MonkUnitInfo extends DefaultStrategy implements IUnitInfo {
  _unitType: string;
  _HP: number;
  _damage: number;
  _initiative: number;
  _actionType: void;
  _imgPath: any;
  constructor() {
    super(new HealerStrategy());
    this._unitType = "healer";
    this._HP = 70;
    this._damage = 40;
    this._initiative = 20;
    this._imgPath = img;
  }
}
